import React from 'react';
import Head from 'next/head';
import { withRouter } from 'next/router'
import './main.css';
import LandingMX from './components/landing/mx'
import LandingCL from './components/landing/cl'

const App = () => {
  let environment = process.env.COUNTRY_CODE;
  environment != undefined ? environment = process.env.COUNTRY_CODE : environment = 'MX';
  return (
    <section>
      <Head>
        {(() => {
          const items = [];
          if (environment == 'MX') {
            items.push(
              <title>Neltia</title>,
            );
          }
          if (environment == 'CL') {
            items.push(
              <title>Wanna</title>,
            );
          }
          return items;
        })()}
        <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap" />
        <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.4.1/css/bootstrap.min.css" integrity="sha384-Vkoo8x4CGsO3+Hhxv8T/Q5PaXtkKtu6ug5TOeNV6gBiFeWPGFN9MuhOf23Q9Ifjh" crossorigin="anonymous"/>
        <meta property="og:image" content="/_next/static/images/favicon.png"></meta>
        <meta charset="utf-8"></meta>
        <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no"></meta>
        <link rel="shortcut icon" href="/_next/static/images/favicon.png" type="image/x-icon"></link>
        <link rel="icon" href="/_next/static/images/favicon.png" type="image/x-icon"></link>
      </Head>
      <body>
        {(() => {
          const items = [];
          if (environment == 'MX') {
            items.push(
              <LandingMX></LandingMX>,
            );
          }
          if (environment == 'CL') {
            items.push(
              <LandingCL></LandingCL>,
            );
          }
          return items;
        })()}
      <script src="https://code.jquery.com/jquery-3.4.1.slim.min.js" integrity="sha384-J6qa4849blE2+poT4WnyKhv5vZF5SrPo0iEjwBvKU7imGFAV0wwj1yYfoRSJoZ+n" crossorigin="anonymous"></script>
      <script src="https://cdn.jsdelivr.net/npm/popper.js@1.16.0/dist/umd/popper.min.js" integrity="sha384-Q6E9RHvbIyZFJoft+2mJbHaEWldlvI9IOYy5n3zV9zzTtmI3UksdQRVvoxMfooAo" crossorigin="anonymous"></script>
      <script src="https://stackpath.bootstrapcdn.com/bootstrap/4.4.1/js/bootstrap.min.js" integrity="sha384-wfSDF2E50Y2D1uUdj0O3uMBJnjuUD4Ih7YwaYd1iqfktj0Uod8GCExl3Og8ifwB6" crossorigin="anonymous"></script>
      </body>
    </section>
  );
}

export default withRouter(App);
